Das ist der gefühlte 15te Post dieser Art, aber was soll ich machen, es muss halt passen. Mein Name ist **AeQ Blackout** und ich bin seit geraumer Zeit auf der Suche nach einem Duo Partner.

Über mich kann ich sagen, dass ich ein äußerst freundlicher Mensch bin und nie andere beleidige, dass gleiche würde ich mir auch von dir wünschen, du musst nicht immer mit einem Grinsen durch Spiele gehen, aber ich finde es halt nicht so berauschend wenn man seine eigenen Teammitglieder vorführt oder runtermacht. Ich würde mich zusätzlich freuen, wenn deine Mikrofon Qualität befriedigend ist und du wie ich über +18 bist und deine Rolle beherrschst. Mir ist schon klar, dass du nicht Gosu/ Rekkles himself bist und bestimmt deine Fehler hast, mir wäre es wichtig, wenn du Farmen kannst (70% der Minions) und dich Positionieren kannst.

